import { Fragment } from "react";
import { Route, Switch } from "react-router";
import Home from "./components/Home";
import MainNavigation from "./components/layout/MainNavigation";

function App() {
  return (
    <Fragment>
      <MainNavigation/>
      <Switch>
        <Route path="/home">
          <Home/>
        </Route>
        <Route path="/world">
          <Home/>
        </Route>
        <Route path="/arts">
          <Home/>
        </Route>
        <Route path="/science">
          <Home/>
        </Route>
        <Route path="/us">
          <Home/>
        </Route>
      </Switch>
    </Fragment>

  );
}

export default App;
